import { FC } from "react"
import { Input, Typography } from "@mui/material";
import UserStore from "../Store/user-store";
import UserItem from "./User";
import { UserTypes } from "../Types/userForm.interface"
import Button from '@mui/material/Button';
import { observer } from "mobx-react-lite";

const UserList: FC = observer(() => {


    return (
        <>
      <TextField id="standard-basic" label="Standard" variant="standard" />
            <Typography style={{ textAlign: 'center' }} variant="h4" component="h2">Список пользователей</Typography>
            <Button onClick={() => UserStore.fetchUsers()}>Загрузить данные с сервера</Button>

            {
        UserStore.users.map(u =>
            <ul>
                <li>{u.name}</li>
                <li>{u.username}</li>
                <li>{u.phone}</li>
                <li>{u.email}</li>
            </ul>
        )
    }

        </>
    )
})
export default UserList;
